  input: TEXT,SA11A1,SA11A1.74399,"On 8/31/07 we received a contribution from Steven
    Chancellor in the amount of $50,000 which was deposited into our federal account.  Forty
    thousand dollars was transferred to our non-federal account, which can accept
    unlimited contributions from individuals, on 8/31/07.  A letter was sent to Mr.
    Chancellor explaining to him how his contribution was split into our accounts
    and to offer him a chance for a refund.  According to AO 2001-17, the Commission
    has deemed it sufficient to deposit checks that exceed the donor's federal limits
    into our federal account and then to make a transfer to the non-federal account
    for the portion that is over the federal limit.  Therefore, year to date aggregate
    totals reported by Steven Chancellor on our report is a reflection of the federal
    portion of the donor's contributions to date."
